mixed.when(keys: string | Array<string>, builder: object | (value, schema)=> Schema): Schema

Adjust the schema based on a sibling or sibling children fields. You can provide an object
literal where the key is is value or a matcher function, then provides the true schema and/or
otherwise for the failure condition.is conditions are strictly compared (===) if you want to use a different form of equality you
can provide a function like: is: (value) => value == true.Like joi you can also prefix properties with $ to specify a property that is dependent
on context passed in by validate() or isValid. when conditions are additive.let schema = object({
  isBig: boolean(),
  count: number()
    .when("isBig", {
      is: true, // alternatively: (val) => val == true
      then: yup.number().min(5),
      otherwise: yup.number().min(0)
    })
    .when("$other", (other, schema) => (other === 4 ? schema.max(6) : schema))
});

await schema.validate(value, { context: { other: 4 } });
You can also specify more than one dependent key, in which case each value will be spread as an argument.let schema = object({
  isSpecial: boolean(),
  isBig: boolean(),
  count: number().when(["isBig", "isSpecial"], {
    is: true, // alternatively: (isBig, isSpecial) => isBig && isSpecial
    then: yup.number().min(5),
    otherwise: yup.number().min(0)
  })
});

await schema.validate({
  isBig: true,
  isSpecial: true,
  count: 10
});
Alternatively you can provide a function that returns a schema
(called with the value of the key and the current schema).let schema = yup.object({
  isBig: yup.boolean(),
  count: yup.number().when("isBig", (isBig, schema) => {
    return isBig ? schema.min(5) : schema.min(0);
  })
});

await schema.validate({ isBig: false, count: 4 });

